data.text:
@yukkitaru

yuki wakes up to her sobs and is fueled by rage because she was blaming herself for this mess. so he hugs her tightly and breaks in front of her.

"you idiot..." he mumbles, burying his head onto her shoulder. she stiffens at his hold.

@saintmirrenfc Nice gesture to recognise the fact that we will be fan owned come the summer.

To me, that's good news, and I'm delighted. 👏👏

Baffled by the rage in the bulk of the replies... 😳
